import axios from "axios";

const ApiRequest = {
  Session: {
    Login: async (params) => {
      let res = null;
        try {
          res = await axios.post('https://dev.perseo.tv/ws/Login.php', {
              params: {
                user: 'sdf',
                pass: 'dsf',
                device: 'web'
              },
              headers: {
                  'Accept': 'application/json',
                  'Content-Type': 'application/x-www-form-urlencoded',
              },
            })
          } catch (e) {
            this.result.error(e);
        } finally {
            return this.result;
        }
    }
  }
}

export default ApiRequest;
